import React,{useState} from "react";
import { Link } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import SideBar from "../sideBar";

const AddAdmin = () => {
  
    const [loading, setloading] = useState(false);
  
    const InitData = {
      adminName: "",
      age: "",
      mobile: "",
      email: "",
      gender: "",
      DOB: "",
      address: "",
      education: "",
      adminID: Date.now(),
      password: "",
    };
    const [AdminValue, setAdminValue] = useState(InitData);
  
    const HandleDoctorChange = (e) => {
      setAdminValue({ ...AdminValue, [e.target.name]: e.target.value });
    };
    
    // if (data?.isAuthticated === false) {
    //   return <Link to={"/"} />;
    // }
  
    // if (data?.user.userType !== "admin") {
    //   return <Link to={"/dashboard"} />;
    // }
  
    return (
      <>
        <ToastContainer />
        <div className="container">
          <SideBar />
          <div className="AfterSideBar">
            <div className="Main_Add_Doctor_div">
              <h1>Add Admin</h1>
              {/* <img src={admin} alt="doctor" className="avatarimg" /> */}
              <form >
                <div>
                  <label>Name</label>
                  <div className="inputdiv">
                    <input
                      type="text"
                      placeholder="Full Name"
                      name="adminName"
                      value={AdminValue.adminName}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Age</label>
                  <div className="inputdiv">
                    <input
                      type="number"
                      placeholder="Age"
                      name="age"
                      value={AdminValue.age}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Contact Number</label>
                  <div className="inputdiv">
                    <input
                      type="number"
                      placeholder="Emergency Number"
                      name="mobile"
                      value={AdminValue.mobile}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Email</label>
                  <div className="inputdiv">
                    <input
                      type="email"
                      placeholder="abc@abc.com"
                      name="email"
                      value={AdminValue.email}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Gender</label>
                  <div className="inputdiv">
                    <select
                      name="gender"
                      value={AdminValue.gender}
                      onChange={HandleDoctorChange}
                      required
                    >
                      <option value="Choose Gender">Choose Gender</option>
                      <option value="Male">Male</option>
                      <option value="Female">Female</option>
                      <option value="Others">Others</option>
                    </select>
                  </div>
                </div>
                <div>
                  <label>Birthdate</label>
                  <div className="inputdiv">
                    <input
                      type="date"
                      placeholder="dd-mm-yy"
                      name="DOB"
                      value={AdminValue.DOB}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Address</label>
                  <div className="inputdiv adressdiv">
                    <input
                      type="text"
                      placeholder="Address"
                      name="address"
                      value={AdminValue.address}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Education</label>
                  <div className="inputdiv">
                    <input
                      type="text"
                      placeholder="eg.MBBS"
                      name="education"
                      value={AdminValue.education}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
                <div>
                  <label>Password</label>
                  <div className="inputdiv">
                    <input
                      type="text"
                      placeholder="Password"
                      name="password"
                      value={AdminValue.password}
                      onChange={HandleDoctorChange}
                      required
                    />
                  </div>
                </div>
  
                <button type="submit" className="formsubmitbutton">
                  {loading ? "Loading..." : "Submit"}
                </button>
              </form>
            </div>
          </div>
        </div>
      </>
    );
  };
  
  export default AddAdmin;
